import './Intro.css'

const Intro = () =>{
    return (
<div className="intro">
    <div className="left">
        <div className="name">
            <span className="first">Hy ! I AM</span>
            <span className='second'>Arbaj Patel</span>
            <span className="third">Fronted Developer with high level Programming Skills , Producting the Quality work</span>
        </div>
        <button className="btn">Hire me</button>
    </div>
    <div className="right"></div>

</div>
    );
}
export default Intro ;
